Mongoose: Is relationship using virtuals a good practice?<p>In mongodb(mongoose) &amp; NodeJS(express) stack, i know that one to many relationships generally looks like this: (simplified example)</p>
<pre class="lang-js prettyprint-override"><code>const { Schema } = require(&quot;mongoose&quot;);

const DB = require(&quot;../db&quot;);

const companySchema = new Schema({
  name: { type: String, default: &quot;&quot; },
  contacts: [{ type: Schema.Types.ObjectId, ref: &quot;contacts&quot; }],
});

const contactSchema = new Schema({
  fullName: { type: String, default: &quot;&quot; },
  number: { type: String },
  company: { type: Schema.Types.ObjectId, ref: &quot;companies&quot; },
});

const Company = DB.model(&quot;companies&quot;, companySchema);
const Contact = DB.model(&quot;contacts&quot;, contactSchema);

module.exports = {Company,Contact};
</code></pre>
<p>I found out that my workplace always use virtuals for one to many relationship like this:</p>
<pre class="lang-js prettyprint-override"><code>const { Schema } = require(&quot;mongoose&quot;);

const DB = require(&quot;../db&quot;);

const companySchema = new Schema({
  name: { type: String, default: &quot;&quot; },
});
companySchema.virtual(&quot;contacts&quot;, {
  ref: &quot;contacts&quot;,
  localField: &quot;_id&quot;,
  foreignField: &quot;company&quot;,
});

const contactSchema = new Schema({
  fullName: { type: String, default: &quot;&quot; },
  number: { type: String },
  company: { type: Schema.Types.ObjectId, ref: &quot;companies_with_virtuals&quot; },
});

const VirtualContact = DB.model(&quot;contacts&quot;, contactSchema);
const CompanyWithVirtuals = DB.model(&quot;companies&quot;, companySchema);

module.exports = {VirtualContact,CompanyWithVirtuals};
</code></pre>
<p>As far as i know, the pros of using virtuals is that i dont need to update Company everytime i post a new Contact. I just want to know what are the cons of using it, when to use it, and is it actually a good practice?</p>
<p>Im still a junior developer, any insight are appreciated.</p>

