How to remove semi-duplicates in Mongo DB aggregation?<p>Consider the following collection:</p>
<pre><code>[
    {
        &quot;userId&quot;: 1,
        &quot;flagField&quot;: false,
        &quot;extraField&quot;: &quot;1&quot;
    },
    {
        &quot;userId&quot;: 1,
        &quot;flagField&quot;: true,
        &quot;extraField&quot;: &quot;2&quot;
    },
    {
        &quot;userId&quot;: 1,
        &quot;flagField&quot;: true,
        &quot;extraField&quot;: &quot;3&quot;
    },
    {
        &quot;userId&quot;: 1,
        &quot;flagField&quot;: false,
        &quot;extraField&quot;: &quot;4&quot;
    },
    {
        &quot;userId&quot;: 2,
        &quot;flagField&quot;: true,
        &quot;extraField&quot;: &quot;1&quot;
    }
]
</code></pre>
<p>How would one remove semi-duplicates for users based on the <code>&quot;flagField&quot;: true</code> criteria and get the following result?</p>
<pre><code>[
    {
        &quot;userId&quot;: 1,
        &quot;flagField&quot;: true,
        &quot;extraField&quot;: &quot;2&quot;
    },
    {
        &quot;userId&quot;: 2,
        &quot;flagField&quot;: true,
        &quot;extraField&quot;: &quot;1&quot;
    }
]
</code></pre>
<p>Seems that <code>$group</code> stage doesn't provide an accumulator that allows you to pick one full document out of several semi-duplicates based on a condition (<code>flagField:true</code> in this case).</p>
<p>In case there will be several matching documents with <code>&quot;flagField&quot;: true</code> for a given user it's OK to pick any but once again it should be a full original document and not a composition of several semi-duplicates. I.e. all the extra fields should come from the same original document.</p>

